import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import myImg from "../../Assets/avatar.svg";
import Tilt from "react-parallax-tilt";
import {
  AiFillGithub,
  AiOutlineTwitter,
  AiFillInstagram,
} from "react-icons/ai";
import { FaLinkedinIn } from "react-icons/fa";
import catBull from "../../Assets/realcatbull.png";
import piechart from "../../Assets/piechart.png"


function Home7() {
  return (
    <Container fluid className="home-section" id="home">
        <Container className="home-content">
            <center>
            <Row>
            <Col md={12}> 
            <h1 className="token-heading">
            <strong style = {{ fontSize: 45, marginTop: -50 }} className="main-name"> Questions?</strong>
                {/* <strong className="main-name"> *STD*</strong> */}
              </h1>
              <br></br>
              <br></br>
              <br></br>
              <h1 className="token-heading" style = {{ fontSize: 35 }}>
              Feel free to yell at <strong className="numberlol"> alexison.pan@gmail.com</strong>
              </h1>
          </Col>
            </Row>
            </center>
        </Container>
      </Container>
  );
}
export default Home7;
